import {
  LOGIN,
  FETCH_PROJECTS_FOR_DASHBOARD,
  OPEN_DELETE_PROJECT_DIALOG,
  CLOSE_DELETE_PROJECT_DIALOG,
} from '../../../utils/constants';

export const defaultState = {
  isLoggedIn: false,
  projectsFound : [],
  isDeleteDialogOpen: false,
};

const admin = (state = defaultState, action) => {
  switch (action.type) {
    case LOGIN:
      return {
        ...state,
        isLoggedIn: true
      };
    case FETCH_PROJECTS_FOR_DASHBOARD:
      return {
        ...state,
        projectsFound : action.payload
      };
    case OPEN_DELETE_PROJECT_DIALOG:
      return {
        ...state,
        isProjectDialogOpen: true,
        project: state.projectsFound[action.payload]
      };
    case CLOSE_DELETE_PROJECT_DIALOG:
      return {
        ...state,
        isProjectDialogOpen: false,
        project: {}
      };
    default:
      return state;
  }
};

export default admin;
